import React, { Component } from 'react';

class AssidBar extends Component {
  render() {
    return (
      <header className="d-flex flex-column justify-content-center" id='#navbar'>
        <nav className="navbar nav-menu">
          <ul className='d-flex flex-column gap-2'>
            <li><a href="#home" className=" active"><i className='bi bi-house-door h3'></i> <span>Home</span></a></li>
            <li><a href="#about" className=""><i className='bi bi-person h3'></i> <span>About</span></a></li>
            <li><a href="#resume" className=""><i className='bi bi-file-earmark h3'></i> <span>Resume</span></a></li>
            <li><a href="#project" className=""><i className='bi bi-globe h3'></i> <span>Project</span></a></li>
            <li><a href="#services" className=""><i className='bi bi-hdd-stack h3'></i> <span>Services</span></a></li>
            <li><a href="#contact" className=""><i className='bi bi-envelope h3'></i> <span>Contact</span></a></li>
          </ul>
        </nav>
      </header>
    );
  }
}

export default AssidBar;
